import React from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBMask, MDBBtn, MDBView} from 'mdbreact';

class Header extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        collapse: false,
        isWideEnough: false,
      };
      this.onClick = this.onClick.bind(this);
    }

    onClick() {
      this.setState({
        collapse: !this.state.collapse,
      });
    }

    render() {

    if(this.props.data) {
        var greetings = this.props.data.greetings;
        var name = this.props.data.name;
        var occupation= this.props.data.occupation;
        var description= this.props.data.description;
        var city= this.props.data.address.city;
        var networks= this.props.data.social.map(function(network){
            return <li key={network.name}><a href={network.url}><i className={network.className}></i></a></li>
        })
    }

      return (
        <div className="main-wrapper">
          <header className="mainHeader">
              <MDBNavbar className="justify-content-center" color="black" fixed="top" dark expand="md" scrolling transparent>
                <MDBNavbarBrand href="/">
                  <strong>JD</strong>
                </MDBNavbarBrand>
                {!this.state.isWideEnough && <MDBNavbarToggler onClick={this.onClick} />}
                <MDBCollapse isOpen={this.state.collapse} navbar>
                   <MDBNavbarNav className="text-uppercase mx-auto" left>
                       <MDBNavItem active>
                         <MDBNavLink to="/">Home</MDBNavLink>
                       </MDBNavItem>
                       <MDBNavItem>
                         <MDBNavLink to="/aboutme">About</MDBNavLink>
                       </MDBNavItem>
                       <MDBNavItem>
                         <MDBNavLink to="/service">Service</MDBNavLink>
                       </MDBNavItem>
                       <MDBNavItem>
                         <MDBNavLink to="#">Portfolio</MDBNavLink>
                       </MDBNavItem>
                       <MDBNavItem>
                         <MDBNavLink to="#">Contact Us</MDBNavLink>
                       </MDBNavItem>                   
                   </MDBNavbarNav>
                </MDBCollapse>
              </MDBNavbar>

            <MDBView src="/images/bg.jpg">
              <MDBMask overlay="black-strong" className="flex-center flex-column text-white text-center">
                <span className="pb-3">{greetings}</span>  
                <h1>I am {name}</h1>
                <h5 className="pb-3">{occupation}</h5>
                <hr />
                {/* <ul className="social">
                    {networks}
                </ul> */}
                <MDBBtn className="smoothscroll" href="#section1" rounded outline color="warning">Explore More</MDBBtn>
              </MDBMask>
            </MDBView>
          </header>
        </div>
      );
    }
  }

  export default Header;
